    render() {
        return (
            <div>

            <div className="bg main_page" >
            <Link style={{color:"red"}} to="/team">Team</Link>
            <Link style={{color:"red"}} to="/pronite">Pronite</Link>
            <Link style={{color:"red"}} to="/event/gamex">Subevent</Link>
            <Link style={{color:"red"}} to="/sponsors">Sponsor</Link>
            <Link style={{color:"red"}} to="/contact">Contact</Link>
               <img src={logo} className="logo_main" style={{marginTop:"200px"}}/> 
            </div>

            </div>

        )
    }
}
